import { useEffect, useState } from "react";
import Navbar from "../Navbar/navbar";
import Videopart from "../videopart/video";
import axios from "axios";

import Movie from "../Moviepage/moviepage";
import Loading from "./Loading";





function Home() {
    const [movies, setMovies] = useState()

    useEffect(() => {
        async function getMovies() {
            await axios.get("http://127.0.0.1:8000/api/movies/?page=2")
                .then((response) => {

                    setMovies(response.data)

                },
                    (error) => {
                        console.log(error);
                    })
                .catch((error) => {
                    console.log(error)
                })
        }

        getMovies();
    }, [])

    if (movies){
        movies["movies"].map((p,i)=>{
            console.log(p)
        })
        console.log(movies.movies)
    }




    return (
        <>
            <Navbar />
            <Videopart />
            <div className="row">
                {movies &&
                movies['movies'].map((p,i)=>(<div className="col-md-3">
                    <Movie key={i} items={p}></Movie>
                </div>))}
                {!movies &&
                (<div className="loading"><Loading></Loading></div>)}

            </div>
        </>

    )


}



export default Home;
